import React, { Component } from "react";
import "../App.css";

class Header extends Component {
  render() {
    return (
      <div>
        <div className="md:flex md:-mx-4">
          <div className="md:w-10/12 xl:w-8/12 md:px-4 text-center md:mx-auto">
            <h1 className="text-3xl md:text-4xl font-medium mb-4">
              Our Awesome Team
            </h1>
            <p className="text-xl text-gray-900">
              We have created a bunch of quality blocks that will help
              designers, developers and agencies create their websites and web
              apps in no time.
            </p>
            <a
              href="#"
              className="border-2 border-solid border-indigo-600 text-indigo-600 rounded py-2 px-6 hover:bg-indigo-600 hover:text-white transition-colors duration-300 inline-block mt-8"
            >
              Learn more
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
